function getEmailBody(params) {
	const body = {
		from: params.from,
		subject: params.subject
	}
	if (params.toType === 'email') {
		body.to = (params.to || []).join(',')
	} else {
		body.to = params.mailingList
	}
	if (params.format === 'text') {
		body.text = params.text
	} else {
		body.html = params.html
	}

	// optimal
	const keys = {
		template: 'template',
		cc: 'cc',
		bcc: 'bcc',
		tag: 'o:tag',
		campaign: 'o:campaign',
		dkim: 'o:dkim',
		tracking: 'o:tracking',
		clickTracking: 'o:tracking-clicks',
		openTracking: 'o:tracking-opens',
		testMode: 'o:testmode',
		deliveryTime: 'o:deliverytime',
		attachments: 'attachment'
	}

    Object.keys(keys)
    .filter(key => params[key] !== null && params[key] !== undefined)
    .forEach(key => {
    	switch (key) {
      		case 'tag':
      		case 'campaign':
			case 'template':
        		body[keys[key]] = params[key]
        		break
      		case 'dkim':
      		case 'tracking':
      		case 'clickTracking':
      		case 'openTracking':
      		case 'testMode':
				body[keys[key]] = params[key] ? 'yes' : 'no'
        		break
      		case 'deliveryTime':
				body[keys[key]] = params[key].toUTCString()
        		break
      		case 'cc':
      		case 'bcc':
				if (params[key] && params[key].length) {
					body[keys[key]] = (params[key] || []).join(',')
				}
        		break
    	}
  	})

	if (params.customHeaders && params.customHeaders.length) {
		params.customHeaders.forEach(header => {
			body[header.name] = header.value
		}) 
	}

	if (params.attachments && params.attachments.length) {
		body.attachment = (params.attachments || []).map(attachment => {
			return {
				value: attachment.data,
				options: {
					filename: attachment.fileName
				}
			}
		})
	}

	if (params.templateVars && params.templateVars.length) {
		const vars = {}
		params.templateVars.forEach(item => {
			vars[item.name] = item.value
		})
		body['h:X-Mailgun-Variables'] = JSON.stringify(vars)
	}

	return body
}
